class One extends React.Component{
    constructor(props){
        super(props)

        this.state ={
            name : "sohail",
            roll : this.props = "8899",
            Obj : {car : "Audi"},
            Arr : ["Ammi","Abu","sister","And His kids"]
        }
    }

    O(){
        this.setState({
            name : "memon",
            roll : "039905",
            Arr : ["Just Be Patient Sohail"]
        })
    }

    render(){
        return(
            <div>
                <h1>{this.state.name}</h1>
                <button onClick = {() => this.O()} >Press</button>
                <h1>{this.state.roll}</h1>
                <h1>{console.log(this.state.Arr)}</h1>
            </div>
        )
    }
}

export default One;
